import { useAuth } from '../context/AuthContext';

const Header = () => {
  const { account, login, logout, isAuthenticated } = useAuth();

  return (
    <div>
      {isAuthenticated ? (
        <>
          <p>Welcome, {account?.name}</p>
          <button onClick={logout}>Logout</button>
        </>
      ) : (
        <button onClick={login}>Login with Auth0</button>
      )}
    </div>
  );
};
